import '../App.scss';

function Navigation() {
  return (
    <div className="Navigation">
        <div className="navigation-logo-container">
            <img src="../images/Samochodówka-logo.png" alt="logo of the school, deep blue syluette of a car" />
            <h2>Samochodówka</h2>
            <p>W Koszalinie</p>
        </div>
    </div>
  );
}

export default Navigation;
